import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <br/><br/>
      <Button variant="contained" color="primary" className={classes.button}>
        Primary
      </Button>
      </div>
    );
  }
}

export default App;
